const User = (props) => {
    const user = props.user;

    if (props.number === 1){
        return ( <li> {user.firstName} {user.lastName} </li> ); 
    }else{
        return ( <li> {user.firstName} {user.lastName} </li> ); 
    }

}  


export default User
